script: |
  super -f text -I q9257.spq | sort > q9257.out

inputs:
  - name: q9257.spq
    data: |
      SELECT DISTINCT col2 - - + col0 AS col2, + 76 * - - col1 / 81 * + + ( + col2 ) * 29 + + 36 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT NULL >= NULL;
  - name: tab1

outputs:
  - name: q9257.out
    data: |
